import React from "react";
import "./Form.css";

export const Form = (props) => {
  return (
    <div className="conatiner">
      <form>
        <h1>Interaction Title</h1>
        <div className="ui divider"></div>
        <div className="ui form">
          <div className="field"></div>
        </div>
      </form>
    </div>
  );
};
